void printScore(int scores) {
    int i,j,loop=0;
    glBegin(GL_POINTS);
    for(i=0; i<7; i++) {
        for(j=0; j<7; j++) {
            if(ZERO[i][j]==0) glColor3ub(0,0,0);
            else	glColor3ub(222,222,255);
            glVertex2i(69+j,29+i);
            if(score>0) glVertex2i(149+j,29+i);
        }
    }
    if(scores==0) {
        for(i=0; i<7; i++) {
            for(j=0; j<7; j++) {
                if(ZERO[i][j]==0) glColor3ub(0,0,0);
                else	glColor3ub(222,222,255);
                glVertex2i(61+j,29+i);
            }
        }
    }

    while(scores>0) {
        loop++;
        scores=(int)floor(scores/10);
        switch(scores % 10) {
        case 0:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=ZERO[i][j];
                }
            }
            break;
        case 1:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=ONE[i][j];
                }
            }
            break;
        case 2:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=TWO[i][j];
                }
            }
            break;
        case 3:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=THREE[i][j];
                }
            }
            break;
        case 4:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=FOUR[i][j];
                }
            }
            break;
        case 5:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=FIVE[i][j];
                }
            }
            break;
        case 6:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=SIX[i][j];
                }
            }
            break;
        case 7:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=SEVEN[i][j];
                }
            }
            break;
        case 8:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=EIGHT[i][j];
                }
            }
            break;
        case 9:
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    NUM[i][j]=NINE[i][j];
                }
            }
            break;
        }
        if(scores>0) {
            for(i=0; i<7; i++) {
                for(j=0; j<7; j++) {
                    if(NUM[i][j]==0) glColor3ub(0,0,0);
                    else	glColor3ub(222,222,255);
                    glVertex2i(69-(loop*8)+j,29+i);
                    glVertex2i(149-(loop*8)+j,29+i);
                }
            }
        }
    }
    glEnd();
    glFlush();
}

int collDetect(int ystart, int yend, int xstart, int xend) {
    int i,j;
    for(i=ystart; i<=yend; i++) {
        for(j=xstart; j<=xend; j++) {
            if(level[i][j]>0) return 0;
        }
    }
    return 1;
}

